(424, '14', 'Add the \"Data Entry Completed\" under Status Filter', '<p>Add the filter in dynamic (so it should be based on the list of status). missing the \"Data entry completed\" (<a href=\"../../incometax/task/manage)\">https://erp.trionxai.com/incometax/task/manage)</a></p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"data:image/png;base64,\" width=\"703\" height=\"141\"></p>', NULL, '2024-01-28', NULL, '4', '2', NULL, NULL, NULL, NULL, 'major', 'Done', 4, '2024-01-29 08:03:20.000000', '2024-01-29 21:02:42.000000');
