(425, '14', 'Add customer Cell phone number (Customer Task page)', '<p>&nbsp;Add Customer Cell phone number below \"Business Type\" (<a href=\"../../incometax/task/view/17)\">https://erp.trionxai.com/incometax/task/view/17)</a></p>\r\n<p>&nbsp;</p>\r\n<p>When selecting a customer in the Customer Task page, It should prefill the last 4 digits SSN and Cell phone #.&nbsp;<br><br><img src=\"data:image/png;base64,\" width=\"636\" height=\"335\"></p>', NULL, '2024-01-28', NULL, '4', '2', NULL, NULL, NULL, NULL, 'major', 'Done', 4, '2024-01-29 08:07:21.000000', '2024-01-29 20:41:05.000000'),
