(427, '19', 'Backend Integration', '<p>Integrate the Admin Panel to the Job portal Website</p>', NULL, '2024-01-25', NULL, '2', '3', NULL, NULL, NULL, NULL, 'normal', 'Done', 2, '2024-01-30 21:45:26.000000', '2024-02-16 15:30:32.000000'),
(428, '19', 'Frontend Integration for Job website', '<p>Frontend Integration for Job website.<br><br>This is a website where a person can look for a job and companies can post job.</p>', '<p>Frontend already integrated, but we will change the frontend template with a better one</p>', '2024-01-27', NULL, '2', '2', NULL, NULL, NULL, NULL, 'major', 'On Progress', 2, '2024-01-30 21:47:16.000000', '2024-02-16 15:31:06.000000'),
(429, '16', 'Fetch the Admin ID after login to dashboard', '<p>Fetch the Admin ID after an Admin login to the system so that the Admin user can Edit their profile.<br><br>It is also required for the system to understand which Admin user is logged in.</p>', NULL, '2024-01-24', NULL, '4', '3', NULL, NULL, NULL, NULL, 'major', 'Done', 2, '2024-02-01 18:37:47.000000', '2024-02-16 17:57:16.000000'),
(430, '14', 'adding another option under \"Status\" in Manage Taks', '<p>add this new status <strong>In-Progress - Missing Docs <br></strong>(<a href=\"manage)\">https://erp.trionxai.com/project/task/manage)</a><br><br></p>\r\n<p>Also, <strong>correct </strong>the spelling for \"<strong>On Progress</strong>\"<strong>&nbsp;</strong>to \"<strong>In Progress</strong>\"</p>\r\n<p><strong>\"In-Progress - Missing Docs\"</strong></p>\r\n<p><strong>\"Not-In-Drake\"&nbsp;</strong></p>\r\n<p><strong>\"Folder Created Only\"</strong></p>', NULL, '2024-02-06', NULL, '4', '2', NULL, NULL, NULL, NULL, 'normal', 'Done', 4, '2024-02-06 22:23:17.000000', '2024-02-08 20:07:45.000000');
