(432, '14', 'Update the Action Item with \"ICON\" only', '<p>remove the text from the action item box and keep only the icons. Also, when you hover on top of the icon, it should give the name like \"<strong>Edit, View, or Delete</strong>\"<br>now:<br><img src=\"data:image/png;base64,\"></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Desire:&nbsp;</strong></p>\r\n<p><br><img src=\"data:image/png;base64,\" width=\"146\" height=\"176\"></p>', NULL, '2024-02-06', NULL, '4', '2', NULL, NULL, NULL, NULL, 'major', 'Done', 4, '2024-02-06 22:36:36.000000', '2024-02-08 20:07:36.000000');
