(435, '14', 'Timeout page error - fix', '<ol>\r\n<li>when timeout, and if user refresh the page, should re-direct to the login page. (https://erp.trionxai.com)</li>\r\n<li><img src=\"data:image/png;base64,\" width=\"664\" height=\"471\"></li>\r\n<li>redirect <strong>/login</strong> &gt; <strong>https://erp.trionxai.com</strong></li>\r\n</ol>', NULL, '2024-02-06', NULL, '4', '2', NULL, NULL, NULL, NULL, 'normal', 'Not Started', 4, '2024-02-06 23:22:12.000000', NULL);
