(436, '14', 'ADD \"NOT STARTED\" UNDER ESIGNATURE FOR MANAGE CUSTOMER TASK', '<p>ADD ONE MORE OPTION \"<strong>Not Started</strong>\".&nbsp; Also, keep the Default option as \"Not Started\" or show like \"Select an Option\".&nbsp; because not it\'s taking a default option which misleading.&nbsp;</p>\r\n<p><img src=\"data:image/png;base64,\"></p>\r\n<p><img src=\"data:image/png;base64,\"></p>', NULL, '2024-02-07', NULL, '4', '2', NULL, NULL, NULL, NULL, 'normal', 'Done', 4, '2024-02-08 08:51:13.000000', '2024-02-08 20:10:41.000000'),
(437, '14', 'LEFT & RIGHT ARROW NAVIGATION IN THE VIEW PAGE', '<p><strong><a href=\"../../incometax/task/view/2\">https://erp.trionxai.com/incometax/task/view/2</a></strong></p>\r\n<p><strong><a href=\"../../incometax/customer/view/1\">https://erp.trionxai.com/incometax/customer/view/1</a></strong></p>\r\n<p><strong>PLEASE ADD THE ARROW NAVIGATION IN THE VIEW PAGE FOR EACH CUSTOMER AND TASK.</strong></p>', NULL, '2024-02-09', '2024-02-10', '74', '2', NULL, NULL, NULL, NULL, 'normal', 'Done', 74, '2024-02-10 00:28:37.000000', '2024-02-12 19:15:59.000000'),
(438, '14', 'UPDATE THE DROP DOWN FIELDS', '<p>&nbsp;UPDATE THE FOLLOWING DROP DOWN FIELDS <br>1. Assigned By</p>\r\n<p>2. Assigned To</p>\r\n<p>3. Project List&nbsp;</p>\r\n<p>Similar to following fields&nbsp;</p>\r\n<p><strong>\"PRIORITY\"</strong></p>\r\n<p><br><br><a href=\"add\">https://erp.trionxai.com/project/task/add</a></p>\r\n<p>https://erp.trionxai.com/incometax/task/add</p>', NULL, '2024-02-09', '2024-02-10', '74', '2', NULL, NULL, NULL, NULL, 'normal', 'Not Started', 74, '2024-02-10 00:35:49.000000', NULL),
(439, '14', 'CREATE \"ADD\" BUTTON IN THE TASK AND CUSTOMER VIEW', '<p><strong>PLEASE CREATE AN \"ADD\" BUTTON IN THE FOLLOWING VIEW (SIMILLAR TO MANAGE BUTTON-SEE THE SCREENSHOT)</strong></p>\r\n<p><strong><img src=\"data:image/png;base64,\"></strong></p>\r\n<p><strong><a href=\"../../incometax/task/view/2\">https://erp.trionxai.com/incometax/task/view/2</a></strong></p>\r\n<p><strong><a href=\"../../incometax/customer/view/1\">https://erp.trionxai.com/incometax/customer/view/1</a></strong></p>', NULL, '2024-02-09', '2024-02-10', '74', '2', NULL, NULL, NULL, NULL, 'normal', 'Done', 74, '2024-02-10 00:41:48.000000', '2024-02-12 19:15:48.000000'),
(440, '19', 'Add Job details', '<p>Add Job details with all the information from the backend</p>', NULL, '2024-02-14', NULL, '4', '3', NULL, NULL, NULL, NULL, 'normal', 'Done', 2, '2024-02-14 08:53:18.000000', '2024-02-16 15:30:26.000000'),
(441, '19', 'View the job posted in the frontend', '<p>View the job posted in the frontend, and also with details</p>', NULL, '2024-02-14', NULL, '4', '2', NULL, NULL, NULL, NULL, 'normal', 'Done', 2, '2024-02-14 08:53:54.000000', '2024-02-16 15:31:12.000000'),
(442, '16', 'Open AI variable settings', '<p>Add all the Open AI variables such as API key, Chat Model, and other variables in the database instead of adding them in the code.</p>\r\n<p>&nbsp;</p>\r\n<p>When we use the variables for AI Chat, it should be retrieved from the database with a query.</p>', NULL, '2024-02-16', NULL, '4', '3', NULL, NULL, NULL, NULL, 'major', 'Not Started', 2, '2024-02-16 16:55:13.000000', NULL),
(443, '16', 'AI Chat (Prompt and Response)', '<p>Create a page where a user inputs a query and should get a response generated by Chat GPT using the API key</p>', NULL, '2024-02-16', NULL, '4', '2', NULL, NULL, NULL, NULL, 'normal', 'Not Started', 2, '2024-02-16 16:58:45.000000', NULL),
(444, '16', 'Trained AI Chatbot', '<p>Train an AI chatbot so that a user can ask for help or suggestions to that trained chatbox and get their desired answer. Also, after the chatbot generates a response, the user should be able to ask more questions if needed in that same chatbox.</p>', NULL, '2024-02-16', NULL, '4', '3', NULL, NULL, NULL, NULL, 'normal', 'Not Started', 2, '2024-02-16 17:02:37.000000', NULL),
(445, '16', 'Multiple prompt with a single response', '<p>Create fields where the user can input multiple prompts such as heading, body, and conclusion. Upon the user\'s prompt, it will generate a single response for the user.</p>', NULL, '2024-02-16', NULL, '4', '2', NULL, NULL, NULL, NULL, 'normal', 'Not Started', 2, '2024-02-16 17:49:20.000000', NULL),
(446, '16', 'Save AI generated response', '<p>When a user gives a prompt, the chat model generates a response. There should be options to Save, Copy that response</p>', NULL, '2024-02-16', NULL, '4', '3', NULL, NULL, NULL, NULL, 'normal', 'Not Started', 2, '2024-02-16 17:53:18.000000', NULL),
(447, '16', 'Save recent 2/3 response in the sesssion', '<p>When a user gives a prompt and gets a response, it should be saved on the website. Only save recent 2 or 3 prompts and responses. It should be saved on the website for 15 days, after 15 days the chat should be removed automatically.</p>', NULL, '2024-02-16', NULL, '4', '2', NULL, NULL, NULL, NULL, 'normal', 'Not Started', 2, '2024-02-16 17:56:17.000000', NULL),
(448, '19', 'Manage Employee and Employer Role', '<p>When registering to the website, the option to select the role whether the user is an Employee or an Employer</p>', NULL, '2024-02-16', NULL, '4', '3', NULL, NULL, NULL, NULL, 'normal', 'Not Started', 2, '2024-02-16 19:22:03.000000', NULL),
(449, '14', 'Add new 2 fields in ERPM', '<p>Add a field named Ticket ID and Phase in Project Manage Task.</p>', NULL, '2024-02-16', NULL, '4', '2', NULL, NULL, NULL, NULL, 'normal', 'Not Started', 2, '2024-02-16 19:25:56.000000', NULL),
(450, '14', 'add edit and delete for all (Manage) View Tables', '<p><a href=\"manage\">https://erp.trionxai.com/project/task/manage</a><br><a href=\"../manage\">https://erp.trionxai.com/project/manage</a><br><a href=\"../../incometax/customer/view/1\">Trionx-AI INC (trionxai.com)</a></p>', NULL, '2024-02-16', NULL, '4', '2', NULL, NULL, NULL, NULL, 'normal', 'Done', 4, '2024-02-16 19:29:03.000000', '2024-02-17 20:41:13.000000'),
(451, '19', 'create a sub-domain for ai job sites', '<p>dev-aijob.trionxai.com</p>', NULL, '2024-02-16', NULL, '4', '2', NULL, NULL, NULL, 'dev-aijob.trionxai.com', 'normal', 'Not Started', 4, '2024-02-16 19:45:14.000000', NULL),
(452, '16', 'create a sub-domain for ai content Site', '<p>dev-ai.trionxai.com</p>', NULL, '2024-02-16', NULL, '4', '2', NULL, NULL, NULL, 'dev-ai.trionxai.com', 'normal', 'Not Started', 4, '2024-02-16 19:46:08.000000', NULL),
(453, '16', 'Decide a type of Database for AI & Job Portal Websites', '<p>PostgreSQL / MongoDB&nbsp; / Redis (AWS) / No-SQL</p>\r\n<p>&nbsp;</p>\r\n<p>Structure vs Unstructure data tyep (database)</p>', NULL, '2024-02-16', NULL, '4', '2', NULL, NULL, NULL, NULL, 'critical', 'Not Started', 4, '2024-02-16 19:50:43.000000', NULL),
(454, '14', 'Redirect the Updated page to Manage Ticket page', '<p>After updating and editing the existing ticket with updated info, and click on update Task, it should redirect to Manage Customer Tickets page.&nbsp;<br><br>example:&nbsp;<br>1. <a href=\"../../incometax/task/edit/21\">https://erp.trionxai.com/incometax/task/edit/21</a></p>\r\n<p>after updating step 1, it should redirect to manage Customer Ticket page:<br>https://erp.trionxai.com/incometax/task/manage</p>', NULL, '2024-02-23', NULL, '4', '2', NULL, NULL, NULL, NULL, 'critical', 'Done', 4, '2024-02-24 00:12:44.000000', '2024-02-25 15:20:47.000000'),
(455, '16', 'Add category for custom template', '<p>Add categories for templates to generate AI content such as Blog Content category, Email Templates category, Website Content category, and more.</p>', NULL, '2024-02-23', NULL, '4', '2', NULL, NULL, NULL, NULL, 'major', 'Not Started', 2, '2024-02-25 13:00:03.000000', NULL);

